(2, 'پیروزی دراماتیک سوئیس مقابل صربستان در دقیقه ۹۰', 'در ادامه دیدارهای دور دوم از مرحله گروهی جام جهانی ۲۰۱۸ روسیه از ساعت ۲۲:۳۰ جمعه شب در گروه E تیم‌های ملی صربستان و سوئیس در شهر کالینینگراد به مصاف هم رفتند که این بازی با پیروزی ۲ بر یک سوئیس‌ خاتمه یافت. گل نخست این بازی را میتروویچ در دقیقه ۵ برای صربستان زد. گرانیت ژاکا در دقیقه ۵۲ و شکیری در دقیقه ۹۰ هم برای سوئیس گلزنی کردند.', '2018-06-23', 3, , 3, 'approved');
